    // --- UTILITY FUNCTIONS (工具函数) ---
    const showToast = (message, duration = 3000) => {
        const settings = GM_getValue('ai_settings', DEFAULT_SETTINGS);
        const toast = document.createElement('div');
        toast.className = 'bili-ai-skipper-toast';
        if (settings.theme === 'dark') {
            toast.classList.add('dark-theme');
        }
        toast.textContent = message;
        document.body.appendChild(toast);

        setTimeout(() => toast.classList.add('show'), 100);
        setTimeout(() => {
            toast.classList.remove('show');
            setTimeout(() => toast.remove(), 300);
        }, duration);
    };

    const makeDraggable = (element, handle = null) => {
        let isDragging = false;
        let currentX, currentY, initialX, initialY;

        const dragElement = handle || element;

        dragElement.addEventListener('mousedown', (e) => {
            isDragging = true;
            initialX = e.clientX - element.offsetLeft;
            initialY = e.clientY - element.offsetTop;
        });

        document.addEventListener('mousemove', (e) => {
            if (isDragging) {
                e.preventDefault();
                currentX = e.clientX - initialX;
                currentY = e.clientY - initialY;
                element.style.position = 'fixed';
                element.style.left = currentX + 'px';
                element.style.top = currentY + 'px';
            }
        });

        document.addEventListener('mouseup', () => {
            isDragging = false;
        });
    };

    const timeStringToSeconds = (timeStr) => {
        const parts = timeStr.split(':');
        if (parts.length === 3) {
            return parseInt(parts[0]) * 3600 + parseInt(parts[1]) * 60 + parseInt(parts[2]);
        } else if (parts.length === 2) {
            return parseInt(parts[0]) * 60 + parseInt(parts[1]);
        }
        return parseInt(timeStr);
    };

    // --- DATA FETCHING FUNCTIONS (数据获取函数) ---
    const getVideoInfo = async (bvid) => {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: 'GET',
                url: `https://api.bilibili.com/x/web-interface/view?bvid=${bvid}`,
                onload: (response) => {
                    try {
                        const data = JSON.parse(response.responseText);
                        if (data.code === 0) {
                            resolve(data.data.cid);
                        } else {
                            reject(new Error('Failed to get video info'));
                        }
                    } catch (error) {
                        reject(error);
                    }
                },
                onerror: reject
            });
        });
    };

    const getDanmakuXml = async (cid) => {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: 'GET',
                url: `https://comment.bilibili.com/${cid}.xml`,
                onload: (response) => {
                    resolve(response.responseText);
                },
                onerror: reject
            });
        });
    };

    const getTopComment = async () => {
        try {
            const oidMatch = window.location.pathname.match(/video\/(BV[1-9A-HJ-NP-Za-km-z]+)/);
            if (!oidMatch) return null;

            const bvid = oidMatch[1];
            const videoInfo = await getVideoInfo(bvid);

            return new Promise((resolve, reject) => {
                GM_xmlhttpRequest({
                    method: 'GET',
                    url: `https://api.bilibili.com/x/v2/reply?type=1&oid=${videoInfo}&sort=2&ps=1`,
                    onload: (response) => {
                        try {
                            const data = JSON.parse(response.responseText);
                            if (data.code === 0 && data.data.replies && data.data.replies.length > 0) {
                                const topComment = data.data.replies[0];
                                if (topComment.member.level_info.current_level >= 4 || topComment.like > 100) {
                                    resolve(topComment.content.message);
                                } else {
                                    resolve(null);
                                }
                            } else {
                                resolve(null);
                            }
                        } catch (error) {
                            resolve(null);
                        }
                    },
                    onerror: () => resolve(null)
                });
            });
        } catch (error) {
            return null;
        }
    };

    // --- DANMAKU PROCESSING (弹幕处理) ---
    const parseAndFilterDanmaku = (xmlText) => {
        const settings = GM_getValue('ai_settings', DEFAULT_SETTINGS);
        const filterKeywords = settings.filterKeywords || DEFAULT_SETTINGS.filterKeywords;
        const extractKeywords = settings.extractKeywords || DEFAULT_SETTINGS.extractKeywords;
        const maxCount = settings.maxDanmakuCount || DEFAULT_SETTINGS.maxDanmakuCount;

        const parser = new DOMParser();
        const xmlDoc = parser.parseFromString(xmlText, 'text/xml');
        const danmakuElements = xmlDoc.querySelectorAll('d');

        let filteredDanmaku = [];

        danmakuElements.forEach(d => {
            const content = d.textContent.trim();
            const attr = d.getAttribute('p');
            if (!attr) return;

            const [timestamp] = attr.split(',');
            const time = parseFloat(timestamp);

            // 黑名单过滤 - 最高优先级，直接跳过
            if (filterKeywords.some(keyword => content.includes(keyword))) {
                return;
            }

            // 检查是否包含提取关键词
            const hasKeyword = extractKeywords.some(keyword => content.includes(keyword));
            const hasNumber = /\d/.test(content);

            if (hasKeyword || hasNumber) {
                const timeStr = `${Math.floor(time / 60).toString().padStart(2, '0')}:${Math.floor(time % 60).toString().padStart(2, '0')}`;
                filteredDanmaku.push(`[${timeStr}] ${content}`);
            }
        });

        // 限制弹幕数量
        if (filteredDanmaku.length > maxCount) {
            filteredDanmaku = filteredDanmaku.slice(0, maxCount);
        }

        return filteredDanmaku.join('\n');
    };

    // --- MODEL FETCHING (模型获取) ---
    const fetchModels = async (apiProvider, baseUrl, apiKey) => {
        return new Promise((resolve, reject) => {
            let modelsUrl;
            let headers = {
                'Content-Type': 'application/json'
            };

            switch (apiProvider) {
                case 'openai':
                    modelsUrl = 'https://api.openai.com/v1/models';
                    headers['Authorization'] = `Bearer ${apiKey}`;
                    break;
                case 'custom':
                    // 检查是否以#结尾，如果是则直接使用该URL
                    if (baseUrl.endsWith('#')) {
                        reject(new Error('自定义URL以#结尾时，请手动输入模型名称'));
                        return;
                    }
                    modelsUrl = `${baseUrl}/v1/models`;
                    headers['Authorization'] = `Bearer ${apiKey}`;
                    break;
                case 'deepseek':
                    modelsUrl = 'https://api.deepseek.com/v1/models';
                    headers['Authorization'] = `Bearer ${apiKey}`;
                    break;
                default:
                    reject(new Error('该API提供商不支持自动获取模型列表'));
                    return;
            }

            GM_xmlhttpRequest({
                method: 'GET',
                url: modelsUrl,
                headers: headers,
                onload: (response) => {
                    try {
                        if (response.status !== 200) {
                            throw new Error(`获取模型列表失败: ${response.status}`);
                        }
                        const data = JSON.parse(response.responseText);
                        if (data.data && Array.isArray(data.data)) {
                            const models = data.data.map(model => model.id);
                            resolve(models);
                        } else {
                            reject(new Error('API响应格式不正确'));
                        }
                    } catch (error) {
                        reject(error);
                    }
                },
                onerror: () => reject(new Error('网络请求失败')),
                ontimeout: () => reject(new Error('请求超时')),
                timeout: 10000
            });
        });
    };

    // --- AI API FUNCTIONS (AI API函数) ---
    const buildApiRequest = (settings, content) => {
        const { apiProvider, baseUrl, model, apiKey, agentPrompt } = settings;

        const messages = [
            { role: "system", content: agentPrompt },
            { role: "user", content: content }
        ];

        // 处理自定义URL以#结尾的情况
        let finalUrl = baseUrl;
        if (apiProvider === 'custom' && baseUrl.endsWith('#')) {
            finalUrl = baseUrl.slice(0, -1); // 移除末尾的#
        }

        switch (apiProvider) {
            case 'openai':
                return {
                    url: 'https://api.openai.com/v1/chat/completions',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${apiKey}`
                    },
                    data: {
                        model: model,
                        messages: messages,
                        temperature: 0.1,
                        max_tokens: 500
                    }
                };

            case 'custom':
                return {
                    url: baseUrl.endsWith('#') ? finalUrl : `${finalUrl}/v1/chat/completions`,
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${apiKey}`
                    },
                    data: {
                        model: model,
                        messages: messages,
                        temperature: 0.1,
                        max_tokens: 500
                    }
                };

            case 'deepseek':
                return {
                    url: 'https://api.deepseek.com/v1/chat/completions',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${apiKey}`
                    },
                    data: {
                        model: model,
                        messages: messages,
                        temperature: 0.1,
                        max_tokens: 500
                    }
                };

            case 'gemini':
                return {
                    url: `https://generativelanguage.googleapis.com/v1beta/models/${model}:generateContent?key=${apiKey}`,
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    data: {
                        contents: [{
                            parts: [{
                                text: `${agentPrompt}\n\n${content}`
                            }]
                        }],
                        generationConfig: {
                            temperature: 0.1,
                            maxOutputTokens: 500
                        }
                    }
                };

            case 'anthropic':
                return {
                    url: 'https://api.anthropic.com/v1/messages',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${apiKey}`,
                        'anthropic-version': '2023-06-01'
                    },
                    data: {
                        model: model,
                        messages: [{ role: "user", content: `${agentPrompt}\n\n${content}` }],
                        max_tokens: 500,
                        temperature: 0.1
                    }
                };

            default:
                throw new Error(`Unsupported API provider: ${apiProvider}`);
        }
    };

    const parseApiResponse = (settings, responseText) => {
        const { apiProvider } = settings;

        try {
            const data = JSON.parse(responseText);

            switch (apiProvider) {
                case 'openai':
                case 'deepseek':
                case 'custom':
                    return data.choices[0].message.content;

                case 'gemini':
                    return data.candidates[0].content.parts[0].text;

                case 'anthropic':
                    return data.content[0].text;

                default:
                    throw new Error(`Unsupported API provider: ${apiProvider}`);
            }
        } catch (error) {
            throw new Error(`Failed to parse API response: ${error.message}`);
        }
    };

    const callAI = async (danmakuText, topComment) => {
        const settings = GM_getValue('ai_settings', DEFAULT_SETTINGS);

        if (!settings.apiKey) {
            throw new Error('请先在设置中配置API密钥');
        }

        const content = `弹幕内容:\n${danmakuText}\n\n${topComment ? `置顶评论: ${topComment}` : '没有置顶评论'}`;

        const requestConfig = buildApiRequest(settings, content);

        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: 'POST',
                url: requestConfig.url,
                headers: requestConfig.headers,
                data: JSON.stringify(requestConfig.data),
                onload: (response) => {
                    try {
                        if (response.status !== 200) {
                            throw new Error(`API请求失败: ${response.status} ${response.statusText}`);
                        }

                        const aiResponse = parseApiResponse(settings, response.responseText);
                        const cleanedResponse = aiResponse.trim();
                        let jsonMatch = cleanedResponse.match(/\{[\s\S]*\}/);

                        if (!jsonMatch) {
                            jsonMatch = cleanedResponse;
                        } else {
                            jsonMatch = jsonMatch[0];
                        }

                        const result = JSON.parse(jsonMatch);
                        resolve(result);
                    } catch (error) {
                        console.error('AI响应解析错误:', error);
                        reject(new Error(`AI响应解析失败: ${error.message}`));
                    }
                },
                onerror: (error) => {
                    reject(new Error(`网络请求失败: ${error.message || '未知错误'}`));
                },
                ontimeout: () => {
                    reject(new Error('请求超时'));
                },
                timeout: 30000
            });
        });
    };

    // --- PROBABILITY CALCULATION (概率计算) ---
    const calculateFinalProbability = (aiResult, settings) => {
        if (!aiResult.start || !aiResult.end) {
            return {
                ...aiResult,
                finalProbability: aiResult.probability,
                adjustmentNote: "未检测到具体时间段,保持原始概率"
            };
        }

        const startSeconds = timeStringToSeconds(aiResult.start);
        const endSeconds = timeStringToSeconds(aiResult.end);
        const duration = endSeconds - startSeconds;

        const minDuration = settings.minAdDuration || DEFAULT_SETTINGS.minAdDuration;
        const maxDuration = settings.maxAdDuration || DEFAULT_SETTINGS.maxAdDuration;

        let adjustedProbability = aiResult.probability;
        let adjustmentNote = "";

        // 时长验证和调整
        if (duration < minDuration) {
            adjustedProbability *= 0.3; // 时长过短，大幅降低概率
            adjustmentNote = `广告时长仅${duration}秒(少于${minDuration}秒)，概率降低70%`;
        } else if (duration > maxDuration) {
            adjustedProbability *= 0.5; // 时长过长，降低概率
            adjustmentNote = `广告时长${duration}秒(超过${maxDuration}秒)，概率降低50%`;
        } else {
            // 在合理范围内，根据时长微调
            const durationPenalty = settings.durationPenalty || DEFAULT_SETTINGS.durationPenalty;
            const penalty = Math.max(0, (duration / 60 - 1) * durationPenalty);
            adjustedProbability = Math.max(0, adjustedProbability - penalty);

            if (penalty > 0) {
                adjustmentNote = `根据时长(${duration}秒)调整，概率降低${penalty.toFixed(1)}%`;
            } else {
                adjustmentNote = "时长合理，无需调整";
            }
        }

        return {
            ...aiResult,
            finalProbability: Math.round(Math.max(0, Math.min(100, adjustedProbability))),
            adjustmentNote: adjustmentNote
        };
    };

